import React from 'react';
import './Styles.css';

function About() {
  return (
    <div className="mainSpace">
      <center>
        <h1>About Us</h1>
        We are a humble little online site for Revature's Project1 made by Daun,
        Matthew, Shabana, and Uyenvy!
      </center>
    </div>
  );
}

export default About;
